import { firestore } from 'firebase'
import 'firebase/firestore';

import moment from 'moment';

const { Timestamp } = firestore

export function isMomentObj(momentObj){
    return momentObj instanceof moment;
}

export function momentObjToUnixTime(momentObj){
    return momentObj.valueOf();
}

export function isTimestampObj(timestampObj){
    return timestampObj instanceof Timestamp;
}

export function timestampObjToMomentObj(timestampObj){
    console.log()
    return  moment.unix(timestampObj.seconds)
}
